import React from "react";

import '../Css/PiedraPapelTijeraConCSS.css';

function PiedraPapelTijeraConCSS(){
  return(
    <div className="cuerpo">
      <div className="contenedoresImagenes1">
      1
      </div>
      <div className="contenedoresImagenes2">
      2.0
      </div>
      <div className="contenedoresImagenes3">
      3
      </div>
      <div className="contenedoresImagenes4">
      4
      </div>
    </div>
  )
};

export default PiedraPapelTijeraConCSS;
